import * as React from 'react';
import wrapIcon from '../utils/wrapIcon';
const rawSvg = (iconProps) => {
    const { className, primaryFill } = iconProps;
    return React.createElement("svg", { width: 20, height: 20, viewBox: "0 0 20 20", xmlns: "http://www.w3.org/2000/svg", className: className },
        React.createElement("path", { d: "M10 5.49a1 1 0 00-1.6-.81L2.54 8.99c-.68.5-.68 1.52 0 2.02l5.88 4.31a1 1 0 001.59-.8v-3.17l5.4 3.97a1 1 0 001.6-.8V5.48a1 1 0 00-1.6-.81L10 8.65V5.49zm-6.88 4.3L9 5.5v9.02l-5.88-4.3a.25.25 0 010-.41zm7 0L16 5.5v9.02l-5.88-4.3a.25.25 0 010-.41z", fill: primaryFill }));
};
const Rewind20Regular = wrapIcon(rawSvg({}), 'Rewind20Regular');
export default Rewind20Regular;
